import React from "react";
import Card from "./Card";
import img1 from "../src/images/3.jpg";
import img2 from "../src/images/4.jpg";
import img3 from "../src/images/5.jpg";
import img6 from "../src/images/8.jpg";
import img4 from "../src/images/6.jpg";
import img5 from "../src/images/7.jpg";
const Services = () => {
  var cardtitle1 = "Portrait Photography";
  var cardtitle2 = "Portrait Photography";
  var cardtitle3 = "Portrait Photography";
  var cardtitle4 = "Portrait Photography";
  var cardtitle5 = "Portrait Photography";
  var cardtitle6 = "Portrait Photography";
  var content1 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content2 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content3 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content4 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content5 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content6 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card image={img1} cardtitle={cardtitle1} content={content1} />
              <Card image={img2} cardtitle={cardtitle2} content={content2} />
              <Card image={img3} cardtitle={cardtitle3} content={content3} />
              <Card image={img4} cardtitle={cardtitle4} content={content4} />
              <Card image={img5} cardtitle={cardtitle5} content={content5} />
              <Card image={img6} cardtitle={cardtitle6} content={content6} />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
